L = 560
t = 16
def patternCount(string, pattern, k):
	count = 0
	for i in range(0, (len(string) - k + 1)): 
		if(string[i:i+k] == pattern):
			count +=1
	return count

def frequencyWords(string, k):
	count = []
	frequentPatterns = []
	for i in range(0, (len(string) - k + 1)):
		pattern = string[i:i + k]
		count.append(patternCount(string,pattern, k))
	maxCount = t
	for i in range(0, (len(string) - k  + 1)):
		if count[i] == maxCount:
			frequentPatterns.append(string[i: i + k])
	frequentPatterns = list(set(frequentPatterns))
	return frequentPatterns


def uniq(l):
    last = object()
    for item in l:
        if item == last:
            continue
        yield item
        last = item

def sort_and_deduplicate(l):
    return list(uniq(sorted(l, reverse=True)))

